import React from 'react'
import { Box } from '@mui/system';
import { Link } from 'react-router-dom';
const Top = () => {
  return (
    <div>
        <Box component="section" sx={{ p: 5,marginBottom: '20px', border: '1px dashed grey',}}>
            <div>
              <Link to="/home">Test</Link>
            </div>
        </Box>
    </div>
  )
}

export default Top
